import React from 'react'
import { Table, Row, Col, Menu, Card, Input, Select, InputNumber, Divider, Button, Modal, Drawer } from 'antd'
import { TcrbButton, TcrbPopconfirm } from '../../antd-styles/styles'
import { Formik, Field, Form } from "formik";

import SimpleInput from '../../simple-input'

const UserList = () => {
  return (
    <div>
      <Row gutter={[4, 24]}>
        <Col span={2}>
          <TcrbButton className="primary" onClick={() => openModalAddNewRole()} >Add User</TcrbButton>
        </Col>
      </Row>
      <Formik
        initialValues={{ name: "", email: "" }}
        onSubmit={async values => {
          await new Promise(resolve => setTimeout(resolve, 500));
          alert(JSON.stringify(values, null, 2));
        }}
      >
        <Form>
          <Field name="name" type="text" />
          <Field name="email" type="email" />
          <button type="submit">Submit</button>
        </Form>
      </Formik>
    </div>
  )
}

export default UserList
